import React from 'react';

import './Button.css';

const Button = (props) => {
  return (

    <button id={props.buttonId} onClick={props.clicked} 
    className={"button"} 
    type={props.buttonType}
    >
        {props.children}
    </button>
  );
};

export default Button;
